import './App.css';
import {BrowserRouter as Router, Route, Link} from "react-router-dom"
import Login from './components/login';
import profile from './components/login'

function App() {
  return (
    <div className="App">
        <Router>
            <Route path="/login">
                <Login/>
            </Route>
            <Route path="/login">
                <profile/>
            </Route>
        </Router>
    </div>
  );
}

export default App;
